import { Card, CardActions, CardContent, Typography } from "@mui/material";



const Note = ({note}) =>{
    return(
        <Card>
            <CardContent> 
                <Typography>{note.heading}</Typography>
                <Typography>{note.text}</Typography>
            </CardContent>
            <CardActions>

            </CardActions>
        </Card>
    )
}

export default Note;
